[package]
name = "icrate"
version = "0.0.1"
authors = ["Mads Marquart <mads@marquart.dk>"]
edition = "2021"
rust-version = "1.60"

description = "Bindings to Apple's frameworks"
keywords = ["macos", "ios", "cocoa", "apple", "framework"]
categories = [
    "accessibility",
    "api-bindings",
    "development-tools::ffi",
    "external-ffi-bindings",
    "os::macos-apis",
]
readme = "README.md"
repository = "https://github.com/madsmtm/objc2"
documentation = "https://docs.rs/icrate/"
license = "MIT"

[dependencies]
objc2 = { path = "../objc2", version = "=0.3.0-beta.4", default-features = false, optional = true }
block2 = { path = "../block2", version = "=0.2.0-alpha.7", default-features = false, optional = true }

[package.metadata.docs.rs]
default-target = "x86_64-apple-darwin"
features = ["block", "objective-c", "unstable-frameworks-all", "unstable-private", "unstable-docsrs"]

targets = [
    # MacOS
    "x86_64-apple-darwin",
    "aarch64-apple-darwin",
    # "i686-apple-darwin",
    # iOS
    "aarch64-apple-ios",
    "x86_64-apple-ios",
    # "armv7-apple-ios",
    # "i386-apple-ios",
    # GNUStep
    "x86_64-unknown-linux-gnu",
    "i686-unknown-linux-gnu",
    # Windows
    "x86_64-pc-windows-msvc",
]

[[example]]
name = "basic_usage"
required-features = [
    "Foundation",
    "Foundation_NSArray",
    "Foundation_NSDictionary",
    "Foundation_NSEnumerator",
]

[[example]]
name = "delegate"
required-features = [
    "apple",
    "Foundation",
    "Foundation_NSString",
    "AppKit_NSResponder",
]

[[example]]
name = "speech_synthesis"
required-features = [
    "apple",
    "Foundation",
    "Foundation_NSString",
]

[[example]]
name = "nspasteboard"
required-features = [
    "apple",
    "Foundation",
    "Foundation_NSArray",
    "Foundation_NSDictionary",
    "Foundation_NSString",
]

[features]
default = ["std", "apple"]

# Currently not possible to turn off, put here for forwards compatibility.
std = ["alloc", "objc2?/std", "block2?/std"]
alloc = ["objc2?/alloc", "block2?/alloc"]

# Runtime selection. See `objc-sys` for details.
apple = ["objc2?/apple", "block2?/apple"]
gnustep-1-7 = ["objc2?/gnustep-1-7", "block2?/gnustep-1-7"]
gnustep-1-8 = ["gnustep-1-7", "objc2?/gnustep-1-8", "block2?/gnustep-1-8"]
gnustep-1-9 = ["gnustep-1-8", "objc2?/gnustep-1-9", "block2?/gnustep-1-9"]
gnustep-2-0 = ["gnustep-1-9", "objc2?/gnustep-2-0", "block2?/gnustep-2-0"]
gnustep-2-1 = ["gnustep-2-0", "objc2?/gnustep-2-1", "block2?/gnustep-2-1"]

# Expose features that requires Objective-C.
objective-c = ["objc2"]

# Expose features that requires creating blocks.
block = ["objc2?/block", "block2"]

# For better documentation on docs.rs
unstable-docsrs = []

# Private framework functionality
#
# These functions/methods are all marked `unsafe`, since they may not always
# exist.
unstable-private = []

# Make the `ns_string!` macro create the string statically.
#
# Please test it, and report any issues you may find:
# https://github.com/madsmtm/objc2/issues/new
unstable-static-nsstring = []

# Frameworks

AppKit = [
    "Foundation",
    "CoreData",
    # Temporary, since some structs and statics use these
    "AppKit_NSApplication",
    "AppKit_NSCollectionLayoutSection",
    "AppKit_NSCollectionLayoutGroupCustomItem",
    "AppKit_NSCollectionView",
    "AppKit_NSView",
    "AppKit_NSTableView",
    "AppKit_NSTableColumn",
    "AppKit_NSTableRowView",
    "Foundation_NSIndexPath",
    "Foundation_NSArray",
    "Foundation_NSCoder",
]
AuthenticationServices = [
    "Foundation",
    # Temporary, since some structs and statics use these
    "Foundation_NSURL",
]
CoreAnimation = ["Foundation"]
CoreData = [
    "Foundation",
    # Temporary, since some structs and statics use these
    "CoreData_NSAsynchronousFetchResult",
]
Foundation = [
    "objective-c",
    "block",
    "Foundation_NSProxy",
    # Temporary, since some structs and statics use these
    "Foundation_NSError",
    "Foundation_NSAppleEventDescriptor",
    "Foundation_NSHashTable",
    "Foundation_NSMapTable",
    "Foundation_NSProgress",
    # Some fmt::Debug impls require these
    "Foundation_NSString",
    "Foundation_NSDictionary",
    "Foundation_NSEnumerator",
]
Metal = [
    "Foundation",
    # Temporary, since some structs and statics use these
    "Metal_MTLRenderPipelineReflection",
    "Metal_MTLComputePipelineReflection",
]
WebKit = [
    "AppKit",
    "Foundation",
    # Temporary, since some structs and statics use these
    "Foundation_NSAttributedString",
]

# Helps with CI
unstable-frameworks-all = ["unstable-frameworks-ios", "unstable-frameworks-macos-12"]
unstable-frameworks-gnustep = ["AppKit_all", "Foundation_all"]
unstable-frameworks-gnustep-32bit = ["Foundation_all"]
unstable-frameworks-ios = ["AuthenticationServices_all", "CoreData_all", "CoreAnimation_all", "Foundation_all", "Metal_all", "WebKit_all"]
unstable-frameworks-macos-10-7 = ["AppKit_all", "CoreAnimation_all", "CoreData_all", "Foundation_all", "WebKit_all"]
unstable-frameworks-macos-10-13 = ["unstable-frameworks-macos-10-7"]
unstable-frameworks-macos-11 = ["unstable-frameworks-macos-10-13", "AuthenticationServices_all", "Metal_all"]
unstable-frameworks-macos-12 = ["unstable-frameworks-macos-11"]

# Temporary fixes until we can autogenerate these
